import express from "express";

import { createNewUserController } from "../controller/userController.js";
import { createFavouriteLocation } from "../controller/userController.js";
import { userLoginApi } from "../controller/apiController.js"

const router = express.Router();

/**
 *
 * @param {*} app : express app
 */

const initApiRoutes = (app) => {

  router.post("/user/create", createNewUserController);
  router.post("/user/login" , userLoginApi);

  // 
  router.post("/user/favourite/create", createFavouriteLocation);
  //


  return app.use("/api/v1", router);
};

export default initApiRoutes;

